import React from 'react';
import './MainPage.css';

const MainPage = () => {
  return (
    <>
      <nav className="navbar">
        <button className="nav-button">Index</button>
        <button className="nav-button">Download</button>
        <button className="nav-button">Contact Us</button>
        <button className="nav-button">Help Center</button>
        <button className="nav-button">Search</button>
        <button className="nav-button">Login</button>
      </nav>
      <div className="main-content">
        <h1 className="header">产品介绍</h1>
        <p className="subtext">Welcome to CollectPie, the ultimate tool for collecting and managing your data efficiently.</p>
      </div>
    </>
  );
};

export default MainPage;
